clear all
%%
%[text] ## Zadatak

load T_transformed.mat
% grupisanje po starosti
Starost=T_transformed{:,{'age_65_older','median_age'}};
any(isnan(Starost),'all') %[output:3c829ae6]
starostStandardized= normalize (Starost);
% PCA
[coeffSt,scoreSt,latentSt,tsquaredSt,explainedSt]=pca(starostStandardized) %[output:68fea56f] %[output:96a125bb] %[output:62a46243] %[output:190e286c] %[output:9a4d2305]
cumVarSt=cumsum(explainedSt) %[output:065501f7]
numPCSt=find(cumVarSt>=85,1) %[output:33faa841]
score_reducedSt=scoreSt(:,1:numPCSt) %[output:75ea41da]
%obuhvacena 1 varijansa

% grupisanje po vakcinaciji
Vakcinacija=T_transformed{:,{'fully_vaccinated','boosters'}};
any(isnan(Vakcinacija),'all') %[output:446662ef]
vakcinacijaStandardized = normalize(Vakcinacija);
% PCA
[coeffVacc,scoreVacc,latentVacc,tsquaredVacc,explainedVacc]=pca(vakcinacijaStandardized) %[output:37ead58b] %[output:504b2223] %[output:89573805] %[output:3ef84141] %[output:700f7640]
cumVarVacc=cumsum(explainedVacc) %[output:838d81fd]
numPCVacc=find(cumVarVacc>=85,1) %[output:2b8276a1]
score_reducedVacc=scoreVacc(:,1:numPCVacc) %[output:797b68c7]
%obuhvacena 1 varijansa

% grupisanje po GHSI komponentama
GHSI=T_transformed{:,{'Overall','Prevent','Detect','Respond','Health','Norms','Risk','HDI'}};
any(isnan(GHSI),'all') %[output:0ee74954]
ghsiStandardized = normalize (GHSI) %[output:8fb8525b]
% PCA 
[coeffGHSI,scoreGHSI,latentGHSI,tsquaredGHSI,explainedGHSI]=pca(ghsiStandardized) %[output:68a8328b] %[output:2d3cb8da] %[output:55779c67] %[output:2215a4b6] %[output:13e65c31]
cumVarGHSI=cumsum(explainedGHSI) %[output:438cee84]
numPCGHSI=find(cumVarGHSI>=85,1) %[output:65db6979]
score_reducedGHSI=scoreGHSI(:,1:numPCGHSI) %[output:00b18373]
%obuhvaceno 3 varijanse

% grupisanje po mobilnosti
Mobilnost=T_transformed{:,{'mobility_retail','mobility_grocery','mobility_parks','mobility_transit','mobility_workplace','mobility_residential'}};
any(isnan(Mobilnost),'all') %[output:19917ebc]
mobilnostStandardized = normalize(Mobilnost);
% PCA
[coeffMobilnost, scoreMobilnost, latentMobilnost, tsquaredMobilnost, explainedMobilnost] = pca(mobilnostStandardized) %[output:4a030397] %[output:17061436] %[output:2a002263] %[output:8a174a7a] %[output:48cba0da]
cumVarMobilnost=cumsum(explainedMobilnost) %[output:5a84d46c]
numPCMobilnost=find(cumVarMobilnost>=85,1) %[output:1c6565e5]
score_reducedMobilnost=scoreMobilnost(:,1:numPCMobilnost) %[output:64097624]
%obuhvaceno 3 varijanse

%%
%[text] ## korelaciona analiza
% starost
T_starost=table(T_transformed.age_65_older,T_transformed.median_age,score_reducedSt,T_transformed.R_mean);
T_starost.Properties.VariableNames={'age_65_older','median_age','PCA_starost','R_mean'};
[R_st,P_st]=corr(T_starost{:,:},'Type','Pearson') %[output:92093818] %[output:918bb026]
h_st=heatmap(R_st,'Colormap',parula) %[output:074c42a2] %[output:077a69ff]
h_st.XDisplayLabels={'age 65 older','median age','PCA starost','R_{mean}'} %[output:66c095dc] %[output:077a69ff]
h_st.YDisplayLabels={'age 65 older','median age','PCA starost','R_{mean}'} %[output:077a69ff] %[output:07fbd076]
h1_st=heatmap(P_st,'Colormap',parula) %[output:3d54e7b2] %[output:2f6dee3b]
h1_st.XDisplayLabels={'age 65 older','median age','PCA starost','R_{mean}'} %[output:7ebf65e9] %[output:2f6dee3b]
h1_st.YDisplayLabels={'age 65 older','median age','PCA starost','R_{mean}'} %[output:2f6dee3b] %[output:38ddd7ba]
% vakcinacija
T_vakcinacija = table(T_transformed.fully_vaccinated, T_transformed.boosters, score_reducedVacc,T_transformed.R_mean);
T_vakcinacija.Properties.VariableNames={'fully_vaccinated','boosters','PCA_vacc','R_mean'};
[R_vacc,P_vacc]=corr(T_vakcinacija{:,:},'Type','Pearson') %[output:6889bbfe] %[output:97aeea06]
h_vacc=heatmap(R_vacc,'Colormap',parula) %[output:8245c6f2] %[output:0f09fe1c]
h_vacc.XDisplayLabels={'fully vacninated','booster','PCA vakcinacija','R_{mean}'} %[output:9d6a9270] %[output:0f09fe1c]
h_vacc.YDisplayLabels={'fully vacninated','booster','PCA vakcinacija','R_{mean}'} %[output:0f09fe1c] %[output:7c56c03d]
h1_vacc=heatmap(P_vacc,'Colormap',parula) %[output:2b441547] %[output:682a1115]
h1_vacc.XDisplayLabels={'fully vacninated','booster','PCA vakcinacija','R_{mean}'} %[output:0149a94e] %[output:682a1115]
h1_vacc.YDisplayLabels={'fully vacninated','booster','PCA vakcinacija','R_{mean}'} %[output:682a1115] %[output:59039d9a]
% GHSI
T_GHSI= table(T_transformed.Overall,T_transformed.Prevent,T_transformed.Detect,T_transformed.Respond,T_transformed.Health,T_transformed.Norms,T_transformed.Risk,T_transformed.HDI,score_reducedGHSI,T_transformed.R_mean);
T_GHSI.Properties.VariableNames={'overall','prevent','detect','respond','health','norms','risk','HDI','PCA_GHSI','R_mean'};
[R_GHSI,P_GHSI]=corr(T_GHSI{:,:},'Type','Pearson') %[output:9da69f6f] %[output:19035e7f]
h_GHSI=heatmap(R_GHSI,'Colormap',parula) %[output:9602ac89] %[output:4dda3b0d]
h_GHSI.XDisplayLabels={'overall','prevent','detect','respond','health','norms','risk','HDI','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','R_{mean}'} %[output:24f4d1ab] %[output:4dda3b0d]
h_GHSI.YDisplayLabels={'overall','prevent','detect','respond','health','norms','risk','HDI','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','R_{mean}'} %[output:4dda3b0d] %[output:88f645f7]
h1_GHSI=heatmap(P_GHSI,'Colormap',parula) %[output:31d0dd63] %[output:49fae951]
h1_GHSI.XDisplayLabels={'overall','prevent','detect','respond','health','norms','risk','HDI','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','R_{mean}'} %[output:95a6d0da] %[output:49fae951]
h1_GHSI.YDisplayLabels={'overall','prevent','detect','respond','health','norms','risk','HDI','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','R_{mean}'} %[output:49fae951] %[output:18f045dc]
% mobilnost
T_mobilnost = table(T_transformed.mobility_retail,T_transformed.mobility_grocery,T_transformed.mobility_parks,T_transformed.mobility_transit,T_transformed.mobility_workplace,T_transformed.mobility_residential, score_reducedMobilnost, T_transformed.R_mean);
T_mobilnost.Properties.VariableNames={'mobility_retail','mobility_grocery','mobility_parks','mobility_transit','mobility_workplace','mobility_residential','PCA_mobilnost','R_mean'};
[R_mob,P_mob]=corr(T_mobilnost{:,:},'Type','Pearson') %[output:03847fe2] %[output:513f691e]
h_mob=heatmap(R_mob,'Colormap',parula) %[output:412b7345] %[output:9c666d72]
h_mob.XDisplayLabels={'mobility retail','mobility grocery','mobility parks','mobility transit','mobility workplace','mobility residential','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3','R_{mean}'} %[output:03d2f718] %[output:9c666d72]
h_mob.YDisplayLabels={'mobility retail','mobility grocery','mobility parks','mobility transit','mobility workplace','mobility residential','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3','R_{mean}'} %[output:9c666d72] %[output:5a37f1c4]
h1_mob=heatmap(P_mob,'Colormap',parula) %[output:27ebe9d5] %[output:0cd75d22]
h1_mob.XDisplayLabels={'mobility retail','mobility grocery','mobility parks','mobility transit','mobility workplace','mobility residential','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3','R_{mean}'} %[output:035e6dba] %[output:0cd75d22]
h1_mob.YDisplayLabels={'mobility retail','mobility grocery','mobility parks','mobility transit','mobility workplace','mobility residential','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3','R_{mean}'} %[output:0cd75d22] %[output:26f635b8]

