%[text] ## finalna korelacija
T_finalna_korelacija=table(T_transformed.immunity_proxy_deaths,T_transformed.stringency,T_transformed.pop_density,T_transformed.cardiovasc,T_transformed.diabetes,T_transformed.onset,score_reducedSt,score_reducedVacc,score_reducedGHSI,score_reducedMobilnost,T_transformed.R_mean);
T_finalna_korelacija.Properties.VariableNames={'immunity_proxy_deaths','stringency','pop_density','cardiovasc','diabetes','onset','PCA_starost','PCA_vakcinacija','PCA_GHSI','PCA_mobilnost','R_mean'} %[output:3e294025]
[R_final,P_final]=corr(T_finalna_korelacija{:,:},'Type','Pearson') %[output:9f5e3ad9] %[output:9be3e9ab]
